import React, { Component } from 'react'
import axios from 'axios';
import member from 'Member';


class ListMembers extends Component {
    constructor(props) {
        super(props)
        this.state = {members :[]}
    }
    componentDidMount() {
        axios.get(`http://localhost:8092/familytree/member`)
          .then(response => {
            console.log(response.data);
            this.setState({members:response.data})
          }).catch(error =>{
              console.log(error);
          });
      }
      
      render() {
          return (
              <React.Fragment>
                <div align="left">
                <table>
                  <thead>
                    <tr>
                      <th>First Name</th>
                      <th>Last Name</th>
                      <th>Nick Name</th>
                      <th>Happy Birthday</th>
                      <th>Gender</th>
                      <th>Married</th>
                    </tr>
                  </thead>
                  <tbody>
                    {this.state.members.map(member => (
                    <tr key={member.id}>
                      <Member></Member>
                      <td>{member.firstName}</td>
                      <td>{member.lastName}</td>
                      <td>{member.nickName}</td>
                      <td>{member.dateOfBirth}</td>
                      <td>{member.gender}</td>
                      <td>{member.married}</td>
                    </tr>
                    ))}
                  </tbody>
                </table> 
                </div>
              </React.Fragment>
          );
        }
}

export default ListMembers;
